// SignInPopup.js
import React, { useState } from 'react';

const SignInPopup = () => {
  const [isOpen, setIsOpen] = useState(false);

  const togglePopup = () => {
    setIsOpen(!isOpen);
  };

  return (
    <div>
      <button onClick={togglePopup}>Open Sign In</button>

      {isOpen && (
        <div className="popup">
          {/* Your sign-in form and content go here */}
          <h2>Sign In</h2>
          {/* Add your sign-in form elements here */}
          <button onClick={togglePopup}>Close</button>
        </div>
      )}
    </div>
  );
};

export default SignInPopup;
